import React from 'react';

const photos = [
    { src: '../assets/logo.png', alt: 'Edited photograph', caption: 'Stunning Edit Showcase' },
    { src: '../assets/927 Belle Oaks-10.jpg', alt: 'Property at 927 Belle Oaks', caption: '927 Belle Oaks Property' },
    { src: '../assets/Paris Paul Cezanne-22.jpg', alt: 'Related to Paul Cezanne', caption: 'Paris Paul Cezanne View' },
    // Add more images as needed
];

function PhotoGallery() {
    return (
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-4 p-5">
            {photos.map((photo, index) => (
                <div key={index} className="relative overflow-hidden">
                    <img src={photo.src} alt={photo.alt} className="w-full h-auto transform transition duration-500 hover:scale-110" />
                    <div className="absolute inset-0 bg-black bg-opacity-50 opacity-0 hover:opacity-100 duration-500 flex justify-center items-center">
                        <span className="text-white text-center p-3">{photo.caption}</span>
                    </div>
                </div>
            ))}
        </div>
    );
}

export default PhotoGallery;
